const title = `Middleware`;
const content = "\"---\\ntitle: Middleware\\n---\\n# Middleware\\n\\nUsed to extend Modern.js built-in Web Server, only SSR requests are handled by these middleware.\\n\\nUnlike [Hook](/apis/app/runtime/web-server/hook), middleware can be extended using the framework plugin.\\n\\n:::note\\nFor more detail, see [Extend Web Server](/guides/advanced-features/web-server)。\\n\\n:::\\n\\n## Usage\\n\\n```ts\\nimport { Middleware } from '@modern-js/runtime/server';\\n\\nexport const middleware: Middleware = async (context, next) => {};\\nexport const middleware: Middleware[] = [\\n  async (context, next) => {},\\n  async (context, next) => {},\\n];\\n```\\n\\n:::info\\n使用该 API 前，请先执行 `pnpm run new` 新建「Web Server 扩展」源码目录。\\n\\n```bash\\npnpm run new\\n? 请选择你想要的操作 创建工程元素\\n? 新建「Web Server 扩展」源码目录\\n```\\n\\n:::\\n\\n## Function Signature\\n\\n```ts\\ntype MiddlewareContext = {\\n  response: {\\n    set: (key: string, value: string) => void;\\n    status: (code: number) => void;\\n    cookies: {\\n      get: (key: string) => string;\\n      set: (key: string, value: string) => void;\\n      delete: () => void;\\n      clear: () => void;\\n      apply: () => void;\\n    };\\n    raw: (\\n      body: string,\\n      { status, headers }: { status: number; headers: Record<string, any> },\\n    ) => void;\\n    locals: Record<string, any>;\\n  };\\n  request: {\\n    host: string;\\n    pathname: string;\\n    query: Record<string, any>;\\n    cookie: string;\\n    cookies: {\\n      get: (key: string) => string;\\n    };\\n    headers: IncomingHttpHeaders;\\n  };\\n  source: {\\n    req: IncomingMessage;\\n    res: ServerResponse;\\n  };\\n};\\n\\ntype RequestHandler = (\\n  context: Context,\\n  next: NextFunction,\\n) => Promise<void> | void;\\n```\\n\\n### Input\\n\\n- `context`: Middleware context.\\n  - `response`: provides a series of methods to process the response.\\n  - `request`: provides a series of methods to get request info.\\n  - `source`: provides Node.js native `req` and `res` object。\\n- `next`: call next listener（not affect the server process, only current hook）。\\n\\n## Example\\n\\n### Tracking\\n\\n```ts\\nexport const Middleware = () => async (ctx, next) => {\\n  const start = Date.now();\\n  ctx.res.once('finish', () => {\\n    console.log(Date.now() - start);\\n  });\\n};\\n```\\n\\n### Inject Tools & Data\\n\\nModern.js provides `res.locals` to store local variables for the current request.\\n\\n```ts\\nexport const Middleware = () => async (ctx, next) => {\\n  ctx.res.locals.id = 'Modern.js';\\n  ctx.res.locals.rpc = createRpcInstance();\\n});\\n```\\n\"";
